        <img src={props.imageUrl1} alt={props.title1} />
        <p>{props.title1}</p>
        <img src={props.imageUrl2} alt={props.title2} />
      </div>
    </Link>
  );
}

function ListView(props) {
  return (
    <div
      className="list-view"

